          <div className="list"></div>
          <div className="list"></div>
          <div className="list"></div>
        </div>
      </div>
    </Main>
  );
}

export const Main = styled.div`
  display: flex;
  justify-content: center;
  .container {
    width: 80vw;
  }
  .title {
    display: flex;
    justify-content: center;
  }
  .lists {
    display: flex;
    flex-wrap: wrap;
    width: 70vw;
    margin-left: 7vw;
  }
  .list {
    height: 400px;
    width: 300px;
    background-color: #d9d9d9;
    margin: 50px;
  }
`;

export default Recommendation;
